import React, { FunctionComponent } from "react";
import Unit from "../strategy/classes/unit/Unit";
import { generateQueue } from "../Logic/Generatequeue";
import { QueueUI } from "./";

import "./LeftPart.css";
interface LeftPartProps {
  units: Array<Unit>;
}
export const LeftPart: FunctionComponent<LeftPartProps> = props => {
  console.log("start");
  let sortedInitiativeUnits: Array<Unit> = generateQueue(props.units);
  console.log("end");

  const renderCell = () => {
    const unitsArrayUI: any = sortedInitiativeUnits.map((unit, index) => {
      return <QueueUI key={index} currentUnit={unit} currentIndex={index} />;
    });

    return unitsArrayUI;
  };

  return <div className="left-part">{renderCell()}</div>;
};
